import React from 'react';
import AppItinerary from './itinerary.js';
import AppTrip from './trip.js';
import AppExpenses from './expenses.js';
import AppMedia from './media.js';

function AppDashboard() {
  return (
    <div>
      <h1>Dashboard</h1>
      <AppTrip />
      <AppExpenses />
      <AppMedia />
      <AppItinerary />
      {/* You can adjust the layout and the information displayed as per your requirement */}
    </div>
  );
}

export default AppDashboard;
